import React, { Component } from "react";
import axios from "axios";

import "../styles/App.css";
import "../styles/bootstrap.min.css";

// import axios from "axios";
import DetailHome from "./DetailHome.js";
const myReqUrl = "http://127.0.0.1:5000/pembeli/produk?rp=50&p=1";

class Kategori extends Component {
  constructor(props) {
    super(props);
    this.state = {
      listProduk: [],
      username: "",
      isLogin: false
    };
  }

  componentDidMount = () => {
    const self = this;

    axios
      .get(myReqUrl)
      .then(function(response) {
        var allData = response.data.Produk.filter(
          allData => allData.produk_kategori === "Teknik"
        );
        self.setState({ listProduk: allData });
        console.log(response.data);
      })
      .catch(function(error) {
        console.log(error);
      });
  };

  render() {
    const { listNews, username, islogin } = this.state;
    return (
      <div id="container">
        <div className="container-fluid" style={{ padding: "0" }}>
          <div className="contentMargin" />
          <div className="container-fluid">
            <div className="row">
              <div className="col-md-12 col-sm-12 offset-md-0">
                <div id="subtitleProduk">
                  <h1>Produk Terbaru</h1>
                </div>
              </div>
            </div>
          </div>

          <div className="produkHome">
            <div className="container-fluid">
              <div className="row">
                {listProduk.map((item, key) => {
                  return (
                    <DetailHome
                      key={key}
                      nama={item.produk_nama}
                      hargaAwal={item.produk_harga}
                      deskripsi={item.produk_deskripsi}
                      gambar={item.produk_gambar}
                      stok={item.produk_stok}
                      hargaAkhir={item.produk_hargaDiskon}
                      tanggalPost={item.produk_tanggalPost}
                    />
                  );
                })}
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
export default Kategori;
